                            "chargeNumber": $c.number,
                            "pricing": (
                                $changeTierPrice := function($tier, $scale) {
                                    {
                                        "tier": $tier.tier,
                                        "price": $tier.price * $scale,
                                        "endingUnit":  $tier.endingUnit,
                                        "priceFormat":  $tier.priceFormat,
                                        "startingUnit":  $tier.startingUnit
                                    }
                                };

                                $chargePricingBuilder := function() { 
                                    $c.type = "Recurring" and $c.model = "Volume" ?
                                        {
                                            "recurringVolume": {
                                                "tiers": [$c.tiers.$changeTierPrice($, $u.ratioOfBasePrice)]
                                            }
                                        }
                                    : $c.type = "Usage" and $c.model = "Volume" ?
                                        {
                                            "usageVolume": {
                                                "tiers": [$c.tiers.$changeTierPrice($, $u.ratioOfBasePrice)]
                                            }
                                        }
                                     : $c.type = "Recurring" and $c.model = "FlatFee" ?
